import React from 'react';
import { ItemType } from './types';

const ItemGrid = (props) => (
  <div style={{display: 'flex'}}>
    {props.data.map((item: ItemType) => <img style={{width: '20%'}} src={item.image}/>)}
  </div>
)

export default ItemGrid
